import React from 'react';
import CityInformation from './CityInformation';
const cityWeather = require('../sources/city-weather.json');


const CityInfoList = () => {
    const newArray = cityWeather.map(item => (<CityInformation  cityName = {item.name} countryName = {item.sys.country} weatherType = {item.weather[1].main} weatherDescription = {item.weather.description} tempMin = {item.main.temp_min} tempMax = {item.main.temp_max} locationLat = {item.coord.lat} locationLon = {item.coord.lon}/>))
        return (
            <div className = 'container'>
                <h2>Weather</h2>
                <div className = 'blocks-container'> 
                    {newArray}
                </div>
            </div>
        )
    }
    export default CityInfoList;
